//import { Movies } from './views/movies';
import { Characters } from './views/characters';
//import { Quotes } from './views/quotes';
import { headers, APILOTRBooks } from './components/api-lotr';

function App() {
  return (
    <div className="App">
      <Header />
      <Home />
      <Characters />
      <Chapters headers={headers} books={APILOTRBooks} />
      <Footer year={new Date().getFullYear()} />
    </div>
  );
}

export default App;
